import "./App.css";
import Home from "./Home";
import { QueryClient, QueryClientProvider } from "react-query";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import NavBar from "./Menu";
import All from "./All";
import Partners from "./Partners";
import Employees from "./Employees";
import Finished from "./Finished";
import Statistics from "./Statistics";
import EditTask from "./About";
import About from "./About";

const queryClient = new QueryClient();

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path="/feladatok">
            <Route index element={<All />} />
            <Route path="reszletek/:id" element={<About />} />
            <Route path="szerkesztes/:id" />
          </Route>
          <Route path="/partnerek">
            <Route index element={<Partners />} />
          </Route>
          <Route path="/dolgozok">
            <Route index element={<Employees />} />
          </Route>
          <Route path="/teljesitett">
            <Route index element={<Finished />} />
          </Route>
          <Route path="/statisztika">
            <Route index element={<Statistics />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </QueryClientProvider>
  );
}

export default App;
